            <div className='quiz-img-header'>
              <img src="Images/quiz-img-header."/>
            </div>
        <h2 style={{textAlign:"center", textDecoration:"none",color:"black"}}><NavLink to="/Subject" className="begin-the-test">Begin the Test</NavLink></h2>
        </div>
        </>
    )
}
